import UIKit

class DetailTransactionCustomerRouter: DetailTransactionCustomerWireframeProtocol {

    weak var viewController: UIViewController?

    static func createModule() -> UIViewController {
        // Change to get view from storyboard if not using progammatic UI
        let view = DetailTransactionCustomerViewController(nibName: nil, bundle: nil)
        let interactor = DetailTransactionCustomerInteractor()
        let router = DetailTransactionCustomerRouter()
        let presenter = DetailTransactionCustomerPresenter(interface: view, interactor: interactor, router: router)

        view.presenter = presenter
        interactor.presenter = presenter
        router.viewController = view

        return view
    }
}
